import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import notes from '../Notes';

function App() {
    return (
        <>
            <Header/>
            <Note
                title="Title"
                content="Content"
            />
            <Footer/>
        </>
    )
}

export default App;
